levels = 0:10:90;
Npoints = 244;
dur = 9.99424e-3;
subjectID = "19001";
side = "IZQ";

% ABR from imported file
abr = ABR.openFile(filename);
%% Check that the number of ABRs is the same
assert(numel(abr) == size(amp,2), 'The number of ABR mismatch')

%% Check amplitudes
assert(isequal(amp, cat(2,abr.amplitude)), 'Amplitudes mismatch')

%% Check Levels
assert(isequal(levels, [abr.level]))

%% Check side
assert(isequal(side, unique([abr.side])))

%% Check subject ID
assert(isequal(subjectID, unique([abr.subjectID])))

%% Check averaging amplitudes
averagedABR = mean(abr);
sameAverage = isequal(averagedABR.amplitude, mean(amp,2));
assert(sameAverage, 'Difference between averaged amplitudes')

%% Check sum of amplitudes
idx = [4 5 8];
S = sum(abr(idx));
sameSum = isequal(S.amplitude,sum(amp(:,idx),2));
assert(sameSum, 'Differnece between sums of amplitudes')



